import React from "react";
import { View, Text, StyleSheet, Image } from "react-native";
import usuarioIcne from "../../../assets/usuario_icone.png";
import imagem from "../../../assets/tela_principal.png";

export default function Home() {

    return (
            <View style={estilos.tela}>
                <View style={estilos.cabecalho}>
                    <View >
                        <Text>Bem-Vindo,    </Text>
                        <Text style={estilos.titulo}>Usuário</Text>
                    </View>
                    <View>
                        <Image source={usuarioIcne} style={estilos.imagem}></Image>
                    </View>
                </View>
                <View style={estilos.cartao}>
                    <View>
                        <Text>Troque e Economize</Text>
                        <Text>Desfrute de uma ótima economia. Desfrute de uma ótima economia</Text>
                    </View>
                    <View>

                    </View>

                </View>
            </View>
    )
}

const estilos = StyleSheet.create({
    tela: {
        margin: 25
    },
    cabecalho:{
        flexDirection:"row",
        justifyContent:"space-between"
    },
    titulo:{
        marginTop:8,
        fontSize:18,
        fontWeight:"bold"
    },
    imagem:{
        width: 50,
        height: 50
    },
    cartao:{
        marginVertical:20,
        backgroundColor:"#FFF",
        borderRadius:10,
        flexDirection:"row",
        padding:20
    }
    
})
